The Cartesian product of two sets A and B, denoted as A × B, is the set of all ordered pairs (a, b) where a is in A and b is in B.

A = {1, 2}
B = {3, 4}

A × B = {(1, 3), (1, 4), (2, 3), (2, 4)}

Now let's calculate the Cartesian product of B and A:

B × A = {(3, 1), (3, 2), (4, 1), (4, 2)}

Comparing the two Cartesian products:

A × B = {(1, 3), (1, 4), (2, 3), (2, 4)}
B × A = {(3, 1), (3, 2), (4, 1), (4, 2)}

A × B and B × A are not equal, as the ordered pairs in each set are different.
